Nəsimi rayonu, Azadlıq prospekti Bakı Sağlamlıq Mərkəzinin yanında inşa edilən NAVASTRYOKANIN 14/16 mərtəbəsində 3 otaq 173 kv.m olan süper  təmirli əşyalı (Classi-dən bahalı mebellər və məişət texnikaları) mənzil satılır. Zövqlü interyer, əla təmir, parket döşəmə, bahalı daxili qapılar, geniş salon, geniş koridor və pəncərələr. Sifarişlə quraşdırılmış mətbəx mebeli və avadanlığı (Bosch). İstilik kombi sistemidir, 2 eyvan, əla vəziyyətdə 2 sanuzel, iki lift, 24 saat mühafizə və təhlükəsizlik sistemi və fərdi açar çipi, şəhərə açılan əla panorama. Qazı, Çıxarışı (Kupçası) var. Ofis haqqı 1 faiz.
